import React from "react";
import { Container } from "react-bootstrap";
import Topbar from "./Navbar";
import "./style.css";


const Back = () => {
    return (
        <div className="cover">
            <div className="cover_overlay">
            <Topbar />

            <Container style={{zIndex: "-1", margin: "200pt"}}>
                <h1>Welcome</h1>
            </Container>
            </div>
        </div>
    )
}

export default Back;
